import logo from './logo.svg';
import './App.css';

function App() {
  const testData = [
    {
      "id":1,
      "english":"Hello!",
      "chinese":"你好！",
      "pinyin":"nǐhǎo!"
    },
    {
      "id":2,
      "english":"You",
      "chinese":"你",
      "pinyin":"nǐ"
    },
    {
      "id": 3,
      "english":"Good",
      "chinese":"好",
      "pinyin":"hǎo"
    }
  ].map( ( {id, english, pinyin, chinese} ) => {
    return <div key={id} className="LessonContent">
      <p>English: {english}</p>
      <p>Pinyin: {pinyin}</p>
      <p>Chinese: {chinese}</p>
    </div>
});
  return (
    <div className="App" stlye="rootStyle">
      <header className="App-header">Learn Chinese!</header>
      {testData}
      <footer className="App-footer">Copyright 2021</footer>
    </div>
  );
}

export default App;
